import React, { Component } from 'react'
import axios from 'axios'
import Cards from '../components/Cards'

export default class Ventas extends Component {
    state = {
        prop: [],
        value: 1
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { value } = this.state
        const tipo = "Venta"

        return (
            <div>
                <Cards
                    list={prop}
                    valor={value}
                    type={tipo}
                />
            </div>
        )
    }
}
